import React, { useState, useEffect } from 'react';
import './PerformanceRubrics.css';

// Import icons
const imgWest = "http://localhost:3845/assets/dab477c6ade2d19b6d463e2d6994e32669d7440c.svg";
const imgWestIcon = "http://localhost:3845/assets/9fc49a8ad4582ec588abb9db25500f5811dbc74c.svg";
const imgHeadset = "http://localhost:3845/assets/a66be842bec527b13441dcf2743fcf4ff6738079.svg";
const imgHeadsetIcon = "http://localhost:3845/assets/3bec8d72294e72fa71bb179a6527aeceab51f3b7.svg";
const imgArrowDown = "http://localhost:3845/assets/dab477c6ade2d19b6d463e2d6994e32669d7440c.svg";

// Skill point definitions
const skillPoints = {
  "Rapport Skills": {
    "Tone": 1,
    "Professional": 1,
    "Conversational Style": 1,
    "Supportive Initial Statement": 1,
    "Affirmation and Praise": 1,
    "Reflection of Feelings": 2,
    "Explores Problem(s)": 1,
    "Values the Person": 1,
    "Non-Judgmental": 1
  },
  "Counseling Skills": {
    "Clarifies Non-Suicidal Safety": 1,
    "Suicide Safety Assessment (SSA/LRA) Initiation and Completion": 4,
    "Exploration of Buffers": 1,
    "Restates then Collaborates Options": 1,
    "Identifies a Concrete Plan": 2,
    "Appropriate Termination (Follow-Up Offered)": 1
  },
  "Organizational Skills": {
    "POP Model – Does Not Rush": 1,
    "POP Model – Does Not Dwell": 1
  },
  "Technical Skills": {
    "Greeting": 1,
    "SSA (LRA) Documentation": 1,
    "Call Documentation / SC Communication": 1
  }
};

// Calculate total possible points (multiplied by 4)
const calculateTotalPossiblePoints = () => {
  let total = 0;
  Object.keys(skillPoints).forEach(category => {
    Object.keys(skillPoints[category]).forEach(skill => {
      total += skillPoints[category][skill];
    });
  });
  return total * 4;
};

const TOTAL_POSSIBLE_POINTS = calculateTotalPossiblePoints();

function PerformanceRubrics({ fileName, s3Url, onBack }) {
  const [rubricData, setRubricData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [expandedSections, setExpandedSections] = useState({});

  const toggleSection = (sectionName) => {
    setExpandedSections(prev => ({
      ...prev,
      [sectionName]: !prev[sectionName]
    }));
  };

  useEffect(() => {
    const fetchRubricData = async () => {
      try {
        // Create sample data with the correct structure
        const sampleData = {
          totalMultipliedScore: 91,
          totalPossibleScore: TOTAL_POSSIBLE_POINTS,
          percentageScore: 91,
          criteria: "Meets Criteria",
          categories: {
            "RAPPORT SKILLS": {
              rawScore: 9,
              multipliedScore: 36,
              criteria: {
                "Tone": { score: 1, label: "Yes", observation: "Calm and supportive tone.", evidence: "00:08.528 AGENT: OK, thank you for giving us a call. What's going on?" },
                "Professional": { score: 1, label: "Yes", observation: "Conversation is appropriate and suitable for a Boys Town Crisis Counselor.", evidence: "00:01.470 AGENT: Vois National hotline, this is Pablo. How can I help you?" },
                "Conversational Style": { score: 1, label: "Yes", observation: "Balanced conversation with back and forth dialogue.", evidence: "00:05.049 CUSTOMER: Hello, I, I just need someone to talk to right now." },
                "Supportive Initial Statement": { score: 1, label: "Yes", observation: "Provided supportive statement at beginning of call.", evidence: "00:08.528 AGENT: OK, thank you for giving us a call. What's going on?" },
                "Affirmation and Praise": { score: 1, label: "Yes", observation: "Offered affirmation to caller.", evidence: "03:15.220 AGENT: That's really good that you're thinking about your future." },
                "Reflection of Feelings": { score: 2, label: "Yes", observation: "Reflected caller's feelings appropriately.", evidence: "02:30.115 AGENT: I can hear how frustrated you are with this situation." },
                "Explores Problem(s)": { score: 1, label: "Yes", observation: "Asked appropriate questions to understand the problem.", evidence: "01:45.330 AGENT: Can you tell me more about what's been going on?" },
                "Values the Person": { score: 1, label: "Yes", observation: "Demonstrated valuing the caller as a person.", evidence: "05:20.440 AGENT: Your feelings are completely valid here." },
                "Non-Judgmental": { score: 1, label: "Yes", observation: "Maintained non-judgmental stance throughout call.", evidence: "06:10.220 AGENT: There's no right or wrong way to feel about this." }
              }
            },
            "COUNSELING SKILLS": {
              rawScore: 10,
              multipliedScore: 40,
              criteria: {
                "Clarifies Non-Suicidal Safety": { score: 1, label: "Yes", observation: "Asked appropriate clarifying questions about potential safety concerns.", evidence: "08:10.170 AGENT: Right. Now you mentioned a little bit about. Suicidal thoughts." },
                "Suicide Safety Assessment (SSA/LRA) Initiation and Completion": { score: 4, label: "Yes", observation: "Conversationally asked the required SSA questions as listed in CMS.", evidence: "08:10.170 AGENT: Right. Now you mentioned a little bit about. Suicidal thoughts." },
                "Exploration of Buffers": { score: 1, label: "Yes", observation: "Explored protective factors and supports.", evidence: "09:25.330 AGENT: Who in your life can you talk to about these feelings?" },
                "Restates then Collaborates Options": { score: 1, label: "Yes", observation: "Summarized situation and worked with caller on options.", evidence: "10:15.220 AGENT: So from what you've told me, you're feeling overwhelmed about college. Let's talk about some options." },
                "Identifies a Concrete Plan": { score: 2, label: "Yes", observation: "Developed specific action steps with caller.", evidence: "11:30.440 AGENT: So your plan is to talk with your guidance counselor tomorrow and look into those scholarship options we discussed." },
                "Appropriate Termination (Follow-Up Offered)": { score: 1, label: "Yes", observation: "Properly concluded call with follow-up options.", evidence: "12:45.115 AGENT: You can always call us back if you need to talk more about this." }
              }
            },
            "ORGANIZATIONAL SKILLS": {
              rawScore: 2,
              multipliedScore: 8,
              criteria: {
                "POP Model - Does Not Rush": { score: 1, label: "Yes", observation: "CC sufficiently explores and understands the problem prior to moving to Options and Plan.", evidence: "04:29.939 AGENT: What makes you think you won't be able to go to college?" },
                "POP Model - Does Not Dwell": { score: 1, label: "Yes", observation: "CC moves through POP model efficiently without excessive time in any one area.", evidence: "07:15.330 AGENT: Now that we understand what's happening, let's talk about what options you have." }
              }
            },
            "TECHNICAL SKILLS": {
              rawScore: 3,
              multipliedScore: 12,
              criteria: {
                "Greeting": { score: 1, label: "Yes", observation: "Greeting is correct and pleasant.", evidence: "00:01.470 AGENT: Vois National hotline, this is Pablo. How can I help you?" },
                "SSA (LRA) Documentation": { score: 1, label: "Yes", observation: "Properly documented safety assessment.", evidence: "Documented in case notes" },
                "Call Documentation / SC Communication": { score: 1, label: "Yes", observation: "Complete and accurate documentation of call.", evidence: "Documented in case notes" }
              }
            }
          }
        };

        // Set the sample data
        setRubricData(sampleData);
      } catch (error) {
        console.error('Error setting rubric data:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchRubricData();
  }, [s3Url]);

  if (loading || !rubricData) {
    return <div className="performance-rubrics-loading">Loading...</div>;
  }

  return (
    <div className="performance-rubrics-container">
      <div className="performance-rubrics-header">
        <div className="back-button" onClick={onBack}>
          <div className="back-icon-container">
            <img src={imgWest} alt="" className="west-arrow" />
            <img src={imgWestIcon} alt="" className="west-icon" />
          </div>
        </div>
      </div>

      <div className="file-info-card">
        <div className="file-icon-container">
          <img src={imgHeadset} alt="" className="headset-icon" />
          <img src={imgHeadsetIcon} alt="" className="headset-icon-inner" />
        </div>
        <div className="file-name">{fileName}</div>
        <div className="overall-score">{Math.round(rubricData.percentageScore)} / 100</div>
        <div className="status-badge">
          <span className="status-text">{rubricData.criteria}</span>
        </div>
      </div>

      <div className="rubrics-card">
        <h2 className="rubrics-title">Detailed Performance Rubrics</h2>

        <div className="rubrics-list">
          {Object.entries(rubricData.categories).map(([categoryName, categoryData]) => {
            // Calculate max possible points for this category
            let maxCategoryPoints = 0;
            const categoryKey = categoryName.replace(/\s+/g, ' ').replace(/-/g, '–');
            const skillCategory = Object.keys(skillPoints).find(k => k.toUpperCase() === categoryKey.toUpperCase());

            if (skillCategory && skillPoints[skillCategory]) {
              Object.values(skillPoints[skillCategory]).forEach(points => {
                maxCategoryPoints += points * 4;
              });
            } else {
              // Fallback if category not found
              maxCategoryPoints = Object.keys(categoryData.criteria).length * 4;
            }

            const percentage = Math.min(100, (categoryData.multipliedScore / maxCategoryPoints) * 100);
            return (
              <div key={categoryName} className="rubric-item">
                <div className="rubric-header" onClick={() => toggleSection(categoryName)}>
                  <div className="rubric-left">
                    <img src={imgArrowDown} alt="" className={`expand-arrow ${expandedSections[categoryName] ? 'expanded' : ''}`} />
                    <h3 className="rubric-name">{categoryName}</h3>
                  </div>
                  <div className="rubric-score">{categoryData.multipliedScore} / {maxCategoryPoints}</div>
                </div>
                <div className="rubric-status">
                  <span className="status-text">Meets Criteria</span>
                </div>
                <div className="progress-bar">
                  <div className="progress-background"></div>
                  <div className="progress-fill" style={{ width: `${percentage}%` }}></div>
                </div>

                {expandedSections[categoryName] && (
                  <div className="criteria-details">
                    {Object.entries(categoryData.criteria).map(([criteriaName, criteriaData]) => (
                      <div key={criteriaName} className="criteria-item">
                        <div className="criteria-header">
                          <span className="criteria-name">{criteriaName}</span>
                          <span className="criteria-score">{criteriaData.score * 4}/{skillPoints[categoryName]?.[criteriaName] ? skillPoints[categoryName][criteriaName] * 4 : 4}</span>
                        </div>
                        <div className="criteria-observation">{criteriaData.observation}</div>
                        <div className="criteria-evidence">{criteriaData.evidence}</div>
                      </div>
                    ))}
                  </div>
                )}
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
}

export default PerformanceRubrics;
